INSERT INTO `mdl_scale` VALUES (1,0,0,'Modos de aprendizagem Isolado e Conexo','Contribui principalmente para a aprendizagem INDIVIDUAL,Aprendizagem Individual e Coletiva por igual,Contribui principalmente para a aprendizagem COLETIVA','A escala baseada na teoria de aprendizagem isolada e conexa. Esta teoria descreve duas formas diferentes de avaliarmos e aprendermos sobre as coisas que vemos e ouvimos.<ul><li><strong>Aprendentes isolados</strong> são tão objetivos quanto possível, evitando sentimentos e emoções. Numa discussão com outras pessoas, gostam de defender as suas próprias ideias, usando a lógica de encontrar lacunas nas ideias dos adversários.</li><li><strong>Aprendentes conexos</strong> são mais sensíveis a outras pessoas. Criam facilmente empatia e preferem ouvir e questionar, até sentir que se podem ligar e \"compreender as coisas do seu ponto de vista\". Aprendem através da partilha das experiências que levaram ao conhecimento que encontram noutras pessoas.</li></ul>',0,1743250721),(2,0,0,'Escala de competência predefinida','Ainda não adquiriu a competência,Adquiriu a competência','Uma escala de avaliação binária que apenas fornece informação acerca da demonstração, ou não, de proficiência.',0,1743250721);
